import React, { useContext, useState, useEffect } from "react";
import { AuthContext } from "../context/AuthContext";
import { Navigate } from "react-router-dom";
import axios from "axios";
import Assignuser from "./Assignuser";
import Detailtask from "../task/Detailtask";
import { Card, Button } from "react-bootstrap";

import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.min.js";
import "font-awesome/css/font-awesome.min.css";

const Assigntask = () => {
  const { loggedIn } = useContext(AuthContext);
  const [tasks, setTasks] = useState([]);
  const [selectAssignTask, setSelectAssignTask] = useState("");
  const [showAssignUserModal, setShowAssignUserModal] = useState(false);
  const [selectDetailTask, setSelectDetailTask] = useState("");
  const [showDetailTaskModal, setShowDetailTaskModal] = useState(false);

  const fetchApproveTasks = async () => {
    try {
      const response = await axios.get(
        "http://localhost:5000/api/getapprovetask",
        {
          withCredentials: true,
        }
      );
      if (response.status === 200) {
        console.log("Tasks Fetched Successfully", response.data.approvedTasks);
        setTasks(response.data.approvedTasks);
      }
    } catch (error) {
      console.error("Error fetching tasks:", error.response.data.error);
    }
  };

  useEffect(() => {
    if (loggedIn) {
      fetchApproveTasks();
    }
  }, [loggedIn]);

  if (!loggedIn) {
    // If the user is not logged in, redirect to the login page
    return <Navigate to="/login" />;
  }

  return (
    <div className="container-fluid mt-5 p-3 border">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <div>
          <center>
            <h1>Assigning Task</h1>
          </center>
        </div>
        <div className="d-flex align-items-center"></div>
      </div>

      <div className="d-flex flex-wrap">
        {tasks.map((task) => (
          <Card key={task.TaskID} style={{ width: "18rem", margin: "10px" }}>
            <Card.Body>
              <Card.Title>{task.TaskTitle}</Card.Title>
              <Card.Subtitle className="mb-2 text-muted">
                ID: {task.TaskID}
              </Card.Subtitle>
              <Card.Text>
                Deadline: {task.TaskDeadline}
                <br />
                Priority:{" "}
                {task.PriorityID === 1
                  ? "Low"
                  : task.PriorityID === 2
                  ? "Medium"
                  : "High"}
                <br />
                Type:{" "}
                {task.TaskTypeID === 1
                  ? "Small Task"
                  : task.TaskTypeID === 2
                  ? "Medium Task"
                  : task.TaskTypeID === 3
                  ? "Large Task"
                  : "Unknown"}
                <br />
                Status: {task.Status}
              </Card.Text>
              <div className="d-flex justify-content-between">
                <Button
                  variant="primary"
                  onClick={() => {
                    setShowAssignUserModal(true);
                    setSelectAssignTask(task.TaskID);
                  }}
                >
                  <i className="fa fa-user-plus me-2" aria-hidden="true"></i>{" "}
                  Assign
                </Button>
                <Button
                  variant="info"
                  onClick={() => {
                    setShowDetailTaskModal(true);
                    setSelectDetailTask(task);
                  }}
                >
                  <i className="fa fa-eye me-2" aria-hidden="true"></i> Detail
                </Button>
              </div>
            </Card.Body>
          </Card>
        ))}
      </div>

      <Assignuser
        showModal={showAssignUserModal}
        selectAssignTask={selectAssignTask}
        handleClose={() => {
          setShowAssignUserModal(false);
        }}
      />
      <Detailtask
        showModal={showDetailTaskModal}
        selectDetailTask={selectDetailTask}
        handleClose={() => {
          setShowDetailTaskModal(false);
          setSelectDetailTask("");
        }}
      />
    </div>
  );
};

export default Assigntask;
